SQLite数据库很方便，但是效率太低，建议换成mySQL或者mariaDB，推荐后者；
前端现在流行用框架，不再是直接写js或者jquery。
我用的是vue.js（主要是上手快），还有大佬们会推荐react框架，都可以试试；
